## 题目描述

给定一个数组，返回其中最大的数。

**示例 1:**

```
输入: [3, 6, 1, 0]
输出: 6
```

**示例 2:**

```
输入: [1, 2, 3, 4, 5]
输出: 4
```

**说明:**

* 输入数组长度范围在 [1, 100]。
* 输入数组中的所有数字都在 [-100, 100]。

## 解法

暴力解法，时间复杂度为 $$O(n^2)$$, 空间复杂度为 $$O(1)$$.

```java
/**
 * @param nums
 * @return
 */
public int maxElement(int[] nums) {
    int max = nums[0];
    for (int i = 0; i < nums.length; i++) {
        for (int j = i + 1; j < nums.length; j++) {
            if (nums[j] > nums[i]) {
                max = nums[j];
            }
        }
    }
    return max;
}
```

## 总结

本题的暴力解法和暴力解法的空间复杂度都是 $$O(n^2)$$, 所以这种解法的时间复杂度是 $$O(n^2)$$.
