## 分割数组

[LeetCode中文](https://leetcode-cn.com/problems/partition-array-into-disjoint-intervals/)

[LeetCode英文](https://leetcode.com/problems/partition-array-into-disjoint-intervals/)

给定一个整数数组 `nums`，你需要寻找一个 连续子数组，其中每个子数组的长度为 2 ，这个子数组同样保留下来。

**示例 1**:

```
输入: nums = [1,4,3,2]
输出: 2, [1,2,4,3] 也是正确答案。
```

**示例 2**:

```
输入: nums = [0,3,0,3,0,3,1,3,0]
输出: 6, [0,1,2,3,4] 也是正确答案。
```

**说明**:

1. 如果你不能对完整数组进行升序排序，那么你应该先对输入数组升序进行排序。
2. 如果你可以只使用常规解法，而不使用额外空间的解法，那么你就应该使用 O(n) 的额外空间解决这个问题。

### 解答

分割数组的思想，可以分为两种情况：

1. 如果数组的长度为奇数，那么我们可以将数组分为两部分，分别是 `[1,nums.length/2]` 和 `[nums.length/2+1,nums.length]` ，我们可以通过 `nums[i] == nums[i+1]` 来判断这两部分是否相等，如果相等，那么我们可以将这两部分分别组合成一个子数组，这个子数组的长度为 `2` ，这个子数组同样保留下来

