## 题目描述

给定一个整数数组，其中每个元素代表一个点，求点的最近距离。

## 解法

### 解法一

解法一的时间复杂度为 $$O(n^2)$$, 空间复杂度为 $$O(1)$$.

```java
/**
 * @param points an array of point
 * @return the distance between the point and the nearest wall
 */
public double distance(Point[] points) {
    double min = Double.MAX_VALUE;
    for (int i = 0; i < points.length; i++) {
        for (int j = i + 1; j < points.length; j++) {
            double dis = Math.sqrt(Math.pow(points[i].x - points[j].x, 2) + Math.pow(points[i].y - points[j].y, 2));
            min = Math.min(min, dis);
        }
    }
    return min;
}
```

### 解法二

解法二的时间复杂度为 $$O(n^2)$$, 空间复杂度为 $$O(1)$$.

```java
