斐波那契数列是一个整数序列，从数列的第一个数开始，后面的数字继续上一个数字的比和。

例如，`[1,2,3,4,5]` 的斐波那契数列是 `[1,2,3,4,5]`，从第一个数 `1` 开始，后面的数字继续上一个数字的比和，直到第二个数字 `5` 才开始上一个数字的比和。

如果不存在这样的数字，请返回 `-1`。

